import { Link } from 'react-router-dom';
import axios from "axios";
import { Button, Container, MainHeading } from './../../GlobalStyle';
import Photo from "./../Photo/Photo";

function Body(){
    const [photos,setPhotos] = useState([]),
        [loading, setLoading] = useState(false),
        [page, setPage] = useState(1),
        [totalPage, SetTotalPage] = useState(0)

    useEffect(() => {
        const getPhotos = async () => {
            setLoading(true);
            try {
                const pho = await axios.get('http://localhost:8000/all-photo')
                console.log(pho.data.photos.photo, "ALL Photo")
                setPhotos(pho.data.photos)
            } catch (error) {
                console.log("ini error: ", error);
            }
        }
    })

    return(
        <Container>
            {photos}
        </Container>
    )
}

export default Body;
